    "2016-05-25T00:44:15.137064",nt"name": "standard-reference-tables",nt"isopen":
    true,nt"url": null,nt"notes": "The Standard Reference Tables (SRT) provide
    consistent reference data for the various applications that support Flight Standards
    Service (AFS) business processes and users. Aviation reference data designate countries,
    states, airports, other types of aviation facilities, and other locations and aircraft.
    Providing a uniform source of standard reference data for these applications will
    eliminate inefficiencies involved and inaccuracies inherent in reconciling discrepancies,
    thus enhancing data quality and improving the accuracy of aviation safety risk identification
    and analysis, ultimately leading to a higher degree of safety",nt"license_title":
